import React from "react";

function Navigation() {
  return (
    <header className="navbar font" >
      <h1>
        <a href="#home" className="anchorNav" style={{fontSize : "20px", alignSelf: "center"}}>email me</a>
      </h1>

      <nav >


        <a href="#contact" className="anchorNav">
          Contact
        </a>

        <a
          href="https://github.com/GiupiDeLuca"
          target="_blank"
          className="anchorNav"
        >
          <i class="fa fa-github" style={{ fontSize: "20px" }}></i>
        </a>
      </nav>
    </header>
  );
}

export default Navigation;
